class FilterModel {
  FilterModel({
    this.total,
    this.data,
  });

  FilterModel.fromJson(dynamic json) {
    total = json['total'] != null ? TotalModel.fromJson(json['total']) : null;
    if (json['data'] != null) {
      data = [];
      json['data'].forEach((v) {
        data?.add(FilterDataModel.fromJson(v));
      });
    }
  }

  TotalModel? total;
  List<FilterDataModel>? data;

  Map<String, dynamic> toJson() {
    final map = <String, dynamic>{};
    if (total != null) {
      map['total'] = total?.toJson();
    }
    if (data != null) {
      map['data'] = data?.map((v) => v.toJson()).toList();
    }
    return map;
  }
}

